import React from "react";

const ImageSlider = () => {
  return (
    <div className="slider-banner row">
      <div
        className="homeslider-container slideshow-panel"
        data-interval="6000"
        data-wrap="true"
        data-pause="hover"
      >
        <ul
          id="owl-image-slider"
          className="image-slide owl-carousel owl-theme owl-loaded owl-drag"
        >
          {/* Individual Slide Items */}
          <div className="owl-stage-outer">
            <div
              className="owl-stage"
              style={{
                transform: "translate3d(-11313px, 0px, 0px)",
                transition: "all 0s ease 0s",
                width: "33939px",
              }}
            >
              {/* Replace this part with your slide content */}
            </div>
          </div>
          {/* Navigation */}
          <div className="owl-nav">
            <div className="owl-prev">
              <i className="fa fa-angle-left"></i>
            </div>
            <div className="owl-next">
              <i className="fa fa-angle-right"></i>
            </div>
          </div>
          {/* Dots */}
          <div className="owl-dots disabled"></div>
        </ul>
      </div>
    </div>
  );
};

export default ImageSlider;
